import React, { useState} from 'react';
import { CKEditor } from "@ckeditor/ckeditor5-react";
import ClassicEditor from "@ckeditor/ckeditor5-build-classic";


function Editor() {
  const [editors, setEditor] = useState([]);


    const createPostFormSubmissionHandler = (event) => {
        event.preventDefault();
        alert("hi")
    }
    return (
        <div>
             <h1>TEST HERE</h1>
      <form onSubmit={createPostFormSubmissionHandler}
                  encType="multipart/form-data">
      <CKEditor
        editor={ClassicEditor}
        config={{
          placeholder: "Add content here...",
          removePlugins: [
            "Heading",
            "Essentials",
            "Italic",
            "Bold",
            "imageUpload",
            "EasyImage",
            "ImageUpload",
            "MediaEmbed",
            "BlockQuote",
            "List",
            "Indent",
            "Table",
            // "link"
          ],
        }}
        data={editors}

        value={editors}
                onChange={(e) => {
                  setEditor(e.target.value);
                }}

      />
      <button type="submit">submit bro</button>
      </form>
        </div>
    )
}

export default Editor
